    public static String getRandomString(double u) {
        Zipf zipf = new Zipf(chars.length, u);

        String str = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789";
        Random random = new Random();

        StringBuffer sb = new StringBuffer();
        for (int j = 1; j <= 130000; j++) {
            int k = zipf.sample();
            sb.append(chars[k - 1]);
            sb.append(",");
            int number = random.nextInt(62);
            sb.append(str.charAt(number));
            sb.append(" ");

            if (j % 180 == 0) {
                sb.append("\r\n");
            }
        }

        return sb.toString();
    }

    public static void writeToTxtByFileWriter(File file, String content) {
        BufferedWriter bw = null;
        try {
            FileWriter fw = new FileWriter(file, true);
            bw = new BufferedWriter(fw);
            bw.write(content);
        } catch (IOException e) {
            e.printStackTrace();
        } finally {
            try {
                bw.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
    }

    //参数：u，数据条数，输出的文件路径
    //每调用一次getRandomString()获得6000个值
    public static void main(String[] args) {
        double u = 0.8;  //Zipf的偏斜度
        int num = 4;  //num大约等于数据的MB数
        String filepath = "D:\\paperData";
        if(args.length > 0) {
            filepath = args[0];
        }
        if(args.length > 1){
            u = Double.parseDouble(args[1]);
        }
        if(args.length > 2){
            num = Integer.parseInt(args[2]);
        }

        String filename = num + "Mb-Join-" + u + "-" + chars.length + "keys.txt";
        System.out.println("**************  Begin to generate!  **************");
        System.out.println("generate " + num + " groups in " + filepath + "/" + filename);
        File file = new File(filepath, filename);
        for (int i = 1; i <= num; i++) {
            writeToTxtByFileWriter(file, getRandomString(u));
            if(i % 10 == 0){
                System.out.println("Generating " + i / 10 + "th group and about "+ i +"M...");
            }
        }
        System.out.println("\"**************  End to generate!  **************\"");
    }
